function displayData() {
    maindiv.textContent=''
    movies.forEach((m,ind) => 
    {

       const movieDiv=document.createElement("div")
       movieDiv.classList.add("movie")
       const movieImage=document.createElement("img")
       movieImage.src=m.image;
       movieImage.alt=m.title
       const movieTitle=document.createElement("h2")
       const moviebutton=document.createElement("button")
       moviebutton.textContent="Delete"
       moviebutton.onclick=function()
       {
        movies.splice(ind,1);
        displayData()
       }
       movieTitle.textContent=m.title;
       movieDiv.append(movieImage,movieTitle,moviebutton)
       maindiv.appendChild(movieDiv)
    })
}
